import React from 'react';
import californiaImage from './images/California.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={californiaImage} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
